HQ very rare promo music video from a promo DVD. &quot;Don't Let Me Down&quot; is a song by the Beatles (with Billy Preston), recorded in 1969 during the Let It Be sessions. It was written by John Lennon and credited to Lennon and McCartney.

Written by Lennon as an anguished love song to Yoko Ono, Paul McCartney interpreted it as a &quot;genuine plea&quot;, with Lennon saying to Ono, &quot;I'm really stepping out of line on this one. I'm really just letting my vulnerability be seen, so you must not let me down.&quot; Lennon's vocals work their way into screams, presaging the primal scream stylings of the following year's John Lennon/Plastic Ono Band album.

Multiple versions of &quot;Don't Let Me Down&quot; were recorded by the Beatles during the tumultuous Get Back (Let It Be) recording sessions. The version recorded on 28 January 1969 was released as a B-side to the single &quot;Get Back&quot;, recorded the same day. &quot;Get Back&quot; reached number one and &quot;Don't Let Me Down&quot; reached number thirty five on the US Billboard Hot 100.

They performed &quot;Don't Let Me Down&quot; twice during their rooftop concert of 30 January 1969, one of which was included in the Let It Be film, directed by Michael Lindsay-Hogg. When the &quot;Get Back&quot; project was revisited, Phil Spector dropped &quot;Don't Let Me Down&quot; from the Let It Be album.

Richie Unterberger of Allmusic called it &quot;one of the Beatles' most powerful love songs&quot;,[11] and Roy Carr and Tony Tyler called it &quot;a superb sobber from misery-expert J. W. O. Lennon, MBE. And still one of the most highly underrated Beatle underbellies.&quot;


The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
